import React from 'react';
import ReactMapGL, { Marker } from "react-map-gl"

function MarkerImage({location}){
    return(
        <div>
            {location.map(l => (
            <Marker 
                key={l.key}
                latitude={l.coord.lat}
                longitude={l.coord.lon}
            />
            ))}
        </div>

    )
}

export default MarkerImage
